"sale_message": "Thank you so much for purchasing from Wizard at Work!  Please let me know if you have questions or if you are looking for a custom item.  I can be reached at wizardatwork12@gmail.com.  \r\n\r\nPlease note, while I always strive to get all my orders out as quickly as possible, orders placed on or after 3.21.15 will be processed when I return from travels on 4.2.15.  If time is a factor for you, please contact me.  I&#39;ll be available by email while I&#39;m away from my work space.\r\n",
