"policy_welcome": "Hey there, thanks for checking on my policies.  I love working with people who have specific needs or wants, so I live by the idea that no question is ridiculous.  Feel free to contact me if you need to work out an order in an unconventional way.",
"policy_payment": null,
"policy_shipping": "Thanks for looking into my shop!\r\n\r\nI ship through the Etsy connection to the US Postal Service for all orders, including international purchases.  I ship the cheapest way possible, which for many of my items is USPS First Class (ground).  If you need your order sent Priority or faster, please contact me so that I can set up a special listing for you with the additional shipping cost.  Thanks!\r\n\r\nIf you do not contact me about rush orders, I will get your order out by the time stated on your Etsy receipt, but cannot guarantee that it will get out any sooner.  I will not accept requests for returns or refunds because you were &quot;hoping&quot; to get it sooner.\r\n\r\nBATH BOMBS (FIZZIES):  Bath bombs require at least two days to cure.  If you&#39;re ordering *only* odds and ends, I can ship them the next day because I have them on hand.  Anything else has to be molded on the day it&#39;s ordered, they need to cure for a full day, which means they&#39;ll get unmolded and packaged the third day and mailed on the fourth.  Or put more simply, if you order them on Monday, they&#39;ll get mailed on Thursday.\r\n\r\nMULTI COLORED SOAPS: The rainbow cube or sticks, the stained glass soaps, the set of fish soaps (which have to be made one at a time) etc... require that each small layer be poured and cooled before the next one can be poured.  This requires more time.  Please allow at least three days for these to be ready to be shipped.\r\n\r\nOther bath and body products (one pour soaps - including tie-dye styles, lotion bars, sugar scrubs, hand sanitizers...) can be produced and packaged either the day they&#39;re ordered or the next day, depending on when the order comes in.\r\n\r\nPlease ask about the lead time needed for large orders.  I love doing bulk orders (I&#39;ve done 600 bath bombs for someone, 85 dinosaur soaps for someone, 80 sets of soaps for wedding favors), but please ask about how much time a given large set needs.  Depending on what you need, I may have to order fragrance oil or base products to ensure I have enough to complete your purchase before I can even begin production.\r\n\r\nOther items, like cards, tags, photos and backpacks are on hand and should be able to ship immediately.\r\n\r\n***** But the best thing you can do is communicate with me either before or right after you order if you need your shipment before a particular date.  Thank you so much! *****\r\n\r\nWhen I&#39;m away from my workshop there will be a message in my Shop Announcements, explaining the length of time I&#39;ll be gone.  When I get back, I will work through orders placed while I was away in the order I received them and they will all go out as soon as possible.  If you place an order and then notice that it will take a significant amount of time to get it to you, feel free to request a cancelation of the the order.  If my travels take me away from the internet (which they occasionally do), I&#39;ll respond as soon as I get back.\r\n\r\nOnce I start producing a custom order of any kind, you cannot cancel the order.  If there is a problem with a custom order requiring you to cancel it, please get ahold of me immediately after placing the order.\r\n\r\n***WRONG ADDRESS***  If you notice after you place your order that Etsy has the wrong address on file for you, the only way I can correct it is for me to cancel your existing order, have you fix your address and re-order.  I know that&#39;s not at all convenient for anyone, but it is the only reliable way for me to make sure your order goes where you want it.",
"policy_refunds": "All of my soaps and bath products are custom made.  This requires time and can lead to slight variations between the photo on my site and your product or between any two products.\r\n\r\nRequests for refunds will be honored under the following circumstances:\r\n    - We discussed an arrival date and the package did not arrive due to errors on my end.\r\n    - I ship the wrong product.\r\n    - The order has not yet been made or shipped and you need to cancel the order.\r\n",
"policy_additional": "So it&#39;s come to this... I am now receiving upwards of 4 messages a week from people who want me to send them a product for free so that they can &#39;review&#39; it on their website/youtube channel/facebook page, etc...\r\n\r\nI am not interested in these promotions.  If you send me a request for free items for a site like this, I will be forwarding it to Etsy&#39;s abuse team as spam.\r\n\r\nI&#39;m sure some of the requests are legitimate and maybe these reviews work for other people, but the sheer numbers of them that I have been receiving recently just makes it look like a lot of people are trying to get something for nothing.  And I don&#39;t want to get into the business of deciding who&#39;s a legitimate &#39;product reviewer&#39; and who&#39;s trying to scam Etsy artists.  So I&#39;m going to make an executive decision to just not be involved in any of them.  Thank you.\r\n\r\n+++++++++\r\n\r\nIf you&#39;re using a coupon code that specifies that a specific item or an specific category of item (any Halloween item or any photo print), or if the coupon code specifies a certain number of items must be bought and... you don&#39;t, I reserve the right to cancel your order.  \r\n\r\nI will make an effort to contact you so we can sort out any miscommunication (maybe you thought something was in a category and I didn&#39;t think of it that way).  I love using the coupon codes, but I&#39;d hate to see them be abused.  Thanks!\r\n\r\n",
