"user_id": 23686361,
"creation_tsz": 1345220528,
"title": "A Garden of Millinery Flowers, Leaves, & Supplies",
"announcement": "Vintage & contemporary millinery flowers & leaves and craft supplies. More items just added to CLEARANCE SALE section!  New and vintage millinery being listed! Please read item descriptions carefully and read my shop policies to familiarize yourself with terms of purchase.",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": null,
"sale_message": "Many thanks from A Pink Swan! I appreciate your business and hope you enjoy your purchase. \r\n\r\n",
"digital_sale_message": null,
"last_updated_tsz": 1432140720,
"listing_active_count": 1249,
"login_name": "pinkswansupplies",
"accepts_custom_requests": true,
"policy_welcome": "Welcome to A Pink Swan! Here is a place to find all sorts of vintage and contemporary millinery flowers & leaves and craft supplies for your creations! I hope you find something that pleases you, and that you&#39;ll visit time and again. Feel free to convo me with questions and requests! ",
"policy_payment": "I accept payment via PayPal, Etsy gift card, or by credit card through Etsy. Payment is expected immediately or the item will be relisted. I am happy to accept requests for custom / reserve listings, however they must be purchased within three (3) days of listing. Reserve listings and custom orders not paid for within 3 days will be removed unless prior arrangements are made. Please do not ask for a reserved listing that you do not intend to buy! All taxes, tariffs, or other fees are the responsibility of the buyer.\r\n\r\nResidents of North Carolina will be charged 6.75% sales tax in accordance with state law.\r\n\r\nPLEASE NOTE: If you find that you must cancel an order, you must do so prior to your order being prepared for shipment. Once your order is boxed and postage is purchased, the order will not be canceled or refunded.  I purchase shipping labels through Etsy, so you will be automatically notified when your order has been packaged for shipment.",
"policy_shipping": "Shipping prices on listings are for First Class mail. If you need expedited shipping, please message me for a quote.\r\n\r\nI will ship your items within three business days (usually same or next business day) of receiving cleared payment via USPS. All millinery items are shipped in boxes to prevent crushing. Shipping charges over actual cost of postage and materials will be cheerfully refunded to your Paypal or credit card account when I package your order. Please make sure that your address on file with Paypal and Etsy is correct as that is the address where your purchase will be shipped! \r\n\r\nI welcome international customers. Quoted rates for international shipments from my shop are estimates - and I will refund any shipping fees that exceed actual cost of packing materials, insurance and postage. All customs and duty fees are the sole responsibility of the buyer. Please note that I make no promises on how long it will take for international packages to arrive as it can range from a few days to a few months - depending on destination and processing through customs. Most international shipments are insured - but I can not file a claim for missing packages until 45 days have passed from the ship date. All requests for missing packages must be received within 90 days of purchase as that is when insurance claim coverage expires! If you need your package quickly, please contact me for pricing on expedited shipping options. You are responsible for knowing about any postal or import restrictions in your country that would prevent delivery to you. I do not falsify customs forms.",
"policy_refunds": "I describe the items I sell accurately and I have a &quot;no refunds&quot; policy unless I have misrepresented an item. If you change your mind when you receive an item, you may return it to me for exchange or shop credit for the original purchase price (excluding postage and shipping costs). The item must be returned within 7 days, and must be in the same condition as when it was sent to you. Return postage is the responsibility of the buyer in all cases. There are no returns or exchanges for items marked as &quot;clearance sale.&quot; Please note: many items I sell are vintage and are sold in &quot;as is&quot; condition. Vintage items may be unused, but they are not new and should not be expected to be in new condition. Please read item descriptions carefully and ask questions before you purchase.",
"policy_additional": "I have two other Etsy shops and I welcome you to visit them. \r\nMeaicp is a place to find whimsical holiday and special event corsages made with vintage party favors and trims. You can find it here www.etsy.com/shop/meaicp\r\n\r\nTheSwanPond is a place to find all sorts of vintage and contemporary floral bouquets, trims and lace, handmade brooches and accessories, and vintage home decor items. You can find it here www.etsy.com/shop/theswanpond",
