"policy_welcome": "Thanks for stopping by my Etsy Shop...\r\n\r\nThese handmade ceramic designs hold the dearest place in my heart and it&#39;s my honor and joy to share them with you.  I&#39;ve been working with clay since I was 7 years old and it&#39;s truly my greatest love.  Lucky you... all this love goes into each and every piece made!\r\n\r\nEach unique design is hand crafted by me, fired and glazed by me and made with pure love.  Completely One-of-a-kind and handcrafted, so no two items are the same... the beauty of handmade!\r\n",
"policy_payment": "Our Shop takes payment via Paypal. Cash or Credit Card\r\nWe make every effort to meet deadlines... however due to the nature and process of this medium, we cannot make any guarantees.  We pride ourselves in meeting buyer deadlines every time.  \r\nDue to the handmade and time intensive made-to-order production process of this medium, we do not accept cancelled orders placed after 24 hours of purchase.  thank you for understanding how much time and care goes into every step of this delicate process from the moment an order is received.  ",
"policy_shipping": "Shipped First Class USPS.  Please allow for up to a week for fulfillment on each piece that is in stock and ready to ship.\r\n\r\nPlease allow for up to a week for fulfillment of each ceramic design that is in stock (unless indicated otherwise under the listing)... Jewelry will come in a gift box, well protected for gift giving!\r\n\r\nCustom Orders or made-to-order, not currently in stock orders, please allow for 3-4 weeks for fulfillment of order for single items and 4-5 weeks for sets/multiples, may be sooner, but just in case as kiln firings vary.\r\n\r\nInternational shipping charges may vary and can be very pricey so know that anything over $3 will happily be refunded (that goes for local shipping too above the cost of S&H, including packaging and boxes); send an inquiry and we can give you an approx. USPS int&#39;l shipping cost.  \r\n\r\nNOTE: rates listed are regular/standard shipping. Registered shipping is $4 extra, simply let me know by message and I will send you an invoice for the $4 *\r\n\r\nNot responsible for any lost/damaged package sent by standard USPS shipping... only if tracking/insurance is purchased by buyer.  \r\n\r\nThe items will be carefully packaged to reduce the chance of items breaking during shipping; however, if you are not willing to take even the slightest risk, please email me prior to purchase to discuss shipping options. Additional fees may apply. \r\n\r\nCustoms may be extra based on location and paid for by buyer.  \r\n",
"policy_refunds": "Please see above for loss/damage policy.  We do not do refunds as each piece is made-to-order and uniquely handmade.  However, we truly want you to be happy with your purchase, so we will happily exchange if for some reason your item is delivered broken and do what we can to work with buyers to ensure a happy transaction.  ",
"policy_additional": "Want a Custom Design? Just ask! We&#39;re happy to get creative and include you in the process!\r\n\r\nWant a certain design, size, color length of necklace?  Just ask!  I custom make almost any design and piece of jewelry and will create a &quot;RESERVE LISTING&quot; just for you!  Please allow ample time for sets, larger items, mugs and custom orders... as drying times vary and every firing is unique.  Custom and set orders allow for 5-6 weeks, sometimes longer.  Delivery time for these orders aren&#39;t guaranteed, is you need a specific time, please convo. us to discuss.  We are happy to &#39;rush&#39; orders, but never want to risk the integrity of your designs in the process.\r\n\r\nCeramic pieces are fragile by nature, as strong as they are from high firing, so please wear and handle with care.  \r\n\r\nNot responsible or liable for the effects of any imperfections and level of food safe, listing is based on the clay body and glaze color alone per manufacturers product.\r\n\r\nThe process of clay is very time intensive and delicate.  Things can happen to a piece of pottery/ceramics at any step in the intricate process.  This may at times delay an on time delivery beyond our control, though know we take our deadlines very seriously and want you to have your one-of-a-kind designs as much as you do!  \r\n\r\nNo two pieces or designs are alike, each piece is hand-crafted with great care and time which renders each piece completely unique and beautiful... the beauty of handmade!   \r\n\r\nNote that monitor calibrations vary so the color/hue that appears on listing may vary from what buyer sees on their screen or receives in person.  \r\nPlease remember, each piece is handmade completely and the nature of the ceramic medium lends to each piece being utterly one-of-a-kind... not two firings are ever the same, so each piece is unique by it&#39;s very nature.  This is the beauty of ceramic works and why we love them so much!  \r\n\r\nPlease leave feedback, we love it!\r\n\r\n",
"policy_seller_info": "please contact me with any questions\r\namichael33 (at)yahoo. com",
