"policy_welcome": "Welcome to VintageSisBro store and thank you for stopping by. Feel free to contact us if you have any questions. I will answer you in English, Russian or Latvian as soon as possible.\r\n\r\nEnjoy!",
"policy_payment": "We accept payment through PayPal only. It&#39;s a safe, simple and easy way to make payments online. Please, make the payment via PayPal at the time of purchase. If it is not received in 32 hours, we cancel the purchase.\r\n\r\nNew to Etsy? This link will guide you through the checkout process, http://www.etsy.com/help_guide_checkout.php",
"policy_shipping": "*** Please make sure your Etsy shipping address is the same as your PayPal address. Otherwise, please send Convo.\r\n\r\nI will ship your package ASAP Monday through Friday. Items are typically shipped within 1-3  business days of receiving cleared payment. Orders ship via LatvijasPasts mail and can take several weeks to arrive. (European Union - 1 week) It may take longer, especially for international customers if customs holds packages.\r\n\r\n*Shipping to USA*\r\nBy experience shipping to USA lasts approx.15-18 days. By first (3-8 days) ALL orders will come to New York Post sort office. And then will travelling within the country. All orders are well trackable in USPS.com\r\n\r\nPLEASE NOTE! Orders are not considered &quot;Lost&quot; in transit until the following amount of time has passed:‚Ä®\r\nDomestic (Latvia): 14 days past shipping date‚Ä®\r\nEuropean Union: 21 days past shipping date‚Ä®\r\nInternational: 45 days past shipping date\r\n\r\n\r\nOne more thing if you didn&#39;t received your item, check the tracking link, because sometimes could be your item are waiting in your post but you didn&#39;t got the notice.",
"policy_refunds": "I accept returns up to 7 days after receive. I will refund the item purchase price minus Etsy and Paypal fees back to your Paypal account once I receive the return. You are responsible for the original shipping costs and return shipping fees. Any item returned must be in the same condition at time of shipment.\r\n\r\nIf it is determined that an error was made by VintageSisBro shipping cost and all other payments/fees will be refunded as well.\r\n\r\nFeel free to convo us, if you have any questions.",
"policy_additional": "- FEEDBACK\r\nI would appreciate it if you leave a positive feedback. If you are not completely satisfied, please contact me before leaving any negative feedback.\r\n- WHOLESALE\r\nWholesale orders are always welcome!If you are interest in, please contact me and I will do my best to give you competitive prices.",
