"description": "Starbucks may have their mermaid--but certainly not as pretty as this one--according to some--;-) She often goes to the Mermaid Cafe where a lot of the sea&#39;s denizens hang out after a &#39;hard day&#39;s work&#39;--harvesting treasures from lost or sunken ships.  Her favorite drink? Why--a large frothy cup of cappuccino, of course--made from the berries of the sea coffee trees--served in a large shell cup with a red coral handle resting on a shell plate. A very whimsical scene with all the shades of  oranges, reds, browns and rusts accented by the curling blue/purple and magenta coral branches. As always, the image doesn&#39;t do justice to the actual print.\r\n\r\nSpecs: limited edition giclee print from an original fantasy art painting by Jade Bengco; approx. 11 X 15 inches on acid-free archival art paper; Edition of only 50 prints; signed/numbered/dated/hand embellished with metallic inks by the artist. Pls. note that the artist retains sole rights (publishing and reproduction) to the images.\r\n\r\nShipping will be priority mail with delivery confirmation. Pls. read shipping policy for more info.\r\n\r\nIf you have any questions regarding the artwork, combined shipping, etc., pls. convo me. \r\nMany thanks!",
