"login_name": "ParisMiniatures",
"accepts_custom_requests": true,
"policy_welcome": "Welcome to the Paris Miniatures Etsy store!\r\n\r\nWe hope you enjoy your visit!\r\n\r\nEmma and Neil\r\n\r\n- https://www.facebook.com/ParisMiniatures \r\n- http://www.parisminiatures.com\r\n- http://parisminiatures.blogspot.com/",
"policy_payment": "Paypal is the required payment method for all orders.  This means that you can use Visa, Mastercard, Amex and many other popular cards to pay for your purchases.  Note that a Paypal account is NOT required to purchase from our store!",
"policy_shipping": "- INTERNATIONAL  SHIPPING -\r\n\r\nWe are in France and we ship internationally.\r\n\r\nAll items are sent via standard basic Airmail, unless you upgrade (recommended!).\r\n\r\n****UPGRADE YOUR ORDER!****\r\n\r\nPlease contact us for a quote if you wish to upgrade your shipping to registered/tracked priority shipping.\r\n\r\nWe strongly advise upgrading your shipping. This will enable you to track your order right here on Etsy. A signature will also be required upon delivery.\r\n\r\nOrders sent without a tracking number are impossible to trace should they be delayed or lost.  The upgrade is worth it for the additional piece of mind.\r\n\r\n- COMBINED SHIPPING AND HANDLING -\r\n\r\nWhen purchasing multiple items, the first item incurs the standard shipping rate and any other items bought in the same transaction will incur only a small extra charge.  See listings for details.\r\n\r\nIf you have transactions spread out over several days, shipping will apply to each transaction.\r\n\r\n- DESPATCH TIME -\r\n\r\nWe generally visit the post office once a week.\r\n\r\nIf you are in a hurry to receive an item, please leave a mark in the &quot;note to seller&quot; portion of your payment and we will try to prioritise it.\r\n\r\n- DELIVERY TIMES -\r\n(These are an average, not a guarantee.  Shipping will be longer at busier times of the year such as Christmas and Easter)\r\n\r\nUnited States/Canada: 5-10 days\r\nEurope: 3-5 days\r\nAsia, Australia, New Zealand: 5-10 days\r\n",
"policy_refunds": "- BREAKAGES - \r\n\r\nIn spite of our careful packing, very occasionally items are damaged by the post office.  If this happens to you please contact us (preferably with a photo of the damage) so that we can advise you further.\r\n\r\n- LOST PACKAGES - \r\n\r\n(We offer a shipping upgrade for every order which will give you a tracking number for your package - https://www.etsy.com/listing/214791632)\r\n\r\nWe do not consider items to be lost until two full months have passed since posting.\r\n\r\n*Packages sent with a tracking number*\r\nAfter the post office investigates, we will remake or refund if necessary (at our discretion).\r\n\r\n*Packages sent without a tracking number* \r\nThese are impossible to trace.  We can not be held responsible for lost items sent in packages without tracking although *where possible* we will remake any missing items.",
