"description": "Handmade and Hand Formed with love from me to you....\r\n\r\nLong Linen Scarf in beautiful earthy dusty brown\r\n\r\nUnisex - perfect for both men and women\r\n\r\nEuropean Linen - Gorgeous! It&#39;s the perfect all season fabric. Linen is warmer than cotton in the winter and cooler than cotton in the summer. This linen scarf is so comfortable, you will love wearing it. Edges are left raw to give it an organic feel and beautiful volume without the weight.\r\n\r\nMany wearing options, as a long scarf, wrap it into an infinity scarf, shawl, swaddle blanket....\r\n\r\nCan make in larger quantities for weddings, etc...\r\n\r\nDETAILS\r\n\r\n~ Dusty Brown\r\n~ Length: 93&quot; / 236 cm\r\n~ Width: 26&quot; / 66 cm\r\n~ 100% European Linen/Flax - Lightweight\r\n~ Hand wash and line dry or machine wash on delicate and gentle dryer cycle.\r\n~ Linen is one of those lovely fabrics that becomes softer over time and washings\r\n\r\n~ I can make this scarf in many colors and also as an infinity scarf\r\n\r\n\r\nPlease convo me with any questions ~ many thanks!\r\n\r\nxx Susan\r\n\r\n__________________________\r\n\r\n\r\nLINEN INFO:\r\n\r\nLINEN, elegant, beautiful, durable, the refined luxury fabric. Linen is the strongest of the vegetable fibers and has 2 to 3 times the strength of cotton. Not only is the linen fiber strong, it is smooth, making the finished fabric lint free\r\n\r\nHighly absorbent and a good conductor of heat, this fabric is cooler than cotton in teh summer and warmer than cotton in the winter\r\n\r\nLinen is one of the oldest and most luxurious of textiles. Favored by ancient Egyptians, who used it as wrappings for royal burials, linen has a history thousands of years old.",
