"title": "Long Casual Jasper Necklace, Gemstone Beaded Jewelry, Cappuccino Jasper Slab Beads, Faceted Goldstone, Vintaj Brass, Beaded, Beadwork",
"description": "This unique necklace features a graduated strand of smooth, polished, African cappuccino jasper and 6mm round faceted goldstone beads. The cappuccino jasper beads have been cut into free-form flat rectangle and trapezoid shapes. They vary in size and shape, with the largest bead just under an inch long.\r\n\r\nAfrican cappuccino jasper is a reddish brown stone with creamy whites and pale grays and highlights of peach and coral. Goldstone is a glittering glass that accents the warm tones in the cappuccino jasper and adds a bit of texture to the necklace.\r\n\r\nThe strand of beads is just under 18 inches, with each end attached to an etched brass ring and brass chain to complete this long necklace. The necklace is secured with a lobster claw clasp and is adjustable from 29 to 31 inches.\r\n\r\nI used Vintaj natural brass chain, wire and findings to make this necklace. Vintaj is 100% natural brass. Its unique and artistic character is achieved through an eco-friendly process, which is nickel-free and lead-free.\r\n\r\n‚ô•  Click on this link to view the shorter version of this necklace:  https://www.etsy.com/listing/220034053/cappuccino-jasper-beaded-necklace-jasper\r\n\r\n‚ô•  Want to purchase this item?  Click on the green ‚ÄúAdd to Cart‚Äù button.\r\n\r\n‚ô•  Have a question about this item or special request for me? Click on the ‚ÄúAsk a Question‚Äù button next to the item‚Äôs price.\r\n\r\n‚ô•  Want to add this item to your wish list? Click on the ‚Äú‚ô• Favorite‚Äù button.\r\n\r\n‚ô•  Want to see other items in my shop? Click on this link:  http://www.beadsandtoast.etsy.com.\r\n\r\nThanks for stopping by!",
