"vacation_message": null,
"sale_message": "Thank you for your purchase! \r\n\r\nI take great care in creating jewelry and I hope you enjoy your purchase to keep for yourself or to give as a gift.\r\n\r\nMelba",
"digital_sale_message": null,
"last_updated_tsz": 1432129483,
