"policy_welcome": "Welcome to BeadsAndToast!",
"policy_payment": "I accept Paypal, Visa, Mastercard (credit cards and debit cards), American Express, Etsy Gift Cards and Money Orders*.\r\n\r\n*If you wish to pay by money order, I accept USPS money orders that can be purchased at any US post office. I will reserve the item(s) you wish to purchase (up to 10 days) until I receive the funds from the money order. Please contact me by selecting &quot;Contact the shop owner&quot; on my shop&#39;s main page for additional information.",
"policy_shipping": "I charge my customers for postage only. Once your order is shipped, I will notify you of any excess postage charges and refund the amount of overpayment.\r\n\r\nUS (Domestic) Customers\r\n*USPS First Class - Packages are shipped via USPS First Class and can be expected within 3-5 days of mailing. \r\n\r\n*USPS Priority - If you would like to upgrade to USPS Priority, please purchase the listing for USPS Priority Mail. The shipping price of this item will cover the additional postage for USPS Priority. Your package can be expected within 2-3 days of mailing.\r\n\r\nInternational Customers\r\nShipping times vary from country to country and are difficult to estimate. Two weeks may be a safe estimate, but you may receive your package within a week or as long as a month or more, depending on your country&#39;s postal service and customs office. Delivery confirmation is generally not provided for international orders. The recipient is responsible for any tariffs or fees (if any) that are collected by the country to which the package is being mailed. \r\n\r\nOrders are shipped within 2 business days of payment (often sooner). If you are in a hurry, just let me know!\r\n\r\nPackaging\r\nYour purchase will be nicely packaged for gift-giving in a kraft paper box tied with a raffia bow and nestled in a bubble mailer for added protection.  \r\n\r\nGift Purchases\r\nIf your purchase is a gift being mailed directly to the recipient, I would be happy to include a note or message to let them know who it&#39;s from! Please include your special instructions in the &quot;message to seller&quot; box when you place your order.\r\n\r\nIf you have any questions about these policies, please select &quot;Contact the shop owner&quot; on my shop&#39;s main page.",
"policy_refunds": "I want you to be happy with your purchase!  \r\n\r\nIf you wish to exchange or return your purchase, for any reason, please contact me within 30 days of receiving your order. I will provide shipping instructions and address any questions or concerns. The item must be returned to me in its original condition. Once I receive it, I will refund the purchase price of the item.\r\n\r\nPlease include tracking when returning a purchase. I also encourage insurance for your protection against loss or damage. \r\n\r\nEarring returns are subject to a $2.00 return fee. (I cannot sell returned ear wires to another customer). \r\n\r\nIf your purchase is lost or damaged during transit, please provide me with prompt notification. I will locate, repair, refund, or replace the item(s). If your purchase is damaged during transit, I may need your cooperation to complete the insurance claim. Please retain the damaged item(s) and packaging. \r\n\r\nIf you have any questions about these policies, please select &quot;Contact the shop owner&quot; on my shop&#39;s main page.\r\n\r\nThank you,\r\nMelba",
"policy_additional": "If you see an item that you like, but would like me to customize it for you, I am happy to work with you. I can usually adjust the length, or other details, based on your request. Please click on the blue link &quot;Request Custom Order&quot; on my shop&#39;s main page to submit your request.\r\n\r\nI create the items in my shop in a smoke-free, pet-free home.",
